 CKEDITOR.dialog.add( 'album', function( editor ) {

	return {
		title: '选择人体示意图',
		minWidth: 600,
		minHeight: 350,
		contents: [ {
			id: 'tab1',
			label: '',
			title: '',
			expand: true,
			padding: 0,
			elements: [
				{
					type: 'html',
          html: '<style type="text/css">'+
          '.main{'+
            'display: flex;'+
            'height: 350px;'+
          '}'+
          '.left-area{'+
            'flex: 2;'+
            '    line-height: 350px;'+
            'text-align: center;'+
          '}'+
          '.right-area{'+
            'flex: 1;'+
            'padding-left: 10px;'+
            'border-left: 2px solid #f4f4f4;'+
          '}'+
          'ul{'+
            'list-style: none;'+
          '}'+
          'ul li{'+
            'line-height: 30px !important;'+
            'text-align: center !important;'+
            'border-bottom: 1px solid #f3f3f3 !important;'+
          '}'+
          '</style>'+
          '<div class="main">'+
          '<div class="left-area">'+
          '<img id="bodyPicId" style="vertical-align: middle;max-width:320px;max-height:320px;" />'+
          '</div>'+
          '<div class="right-area">'+
          '<ul></ul>'+
          '</div>'+
          '</div>'
				}
			]
      } ],
      buttons: [ CKEDITOR.dialog.cancelButton, CKEDITOR.dialog.okButton ],
      onOk: function(e) {
          var path = $('#bodyPicId')[0].src;
          var uuid = "cms"+guid();
          editor.insertHtml('<img style="max-width:480px;max-height:320px;" id="' + uuid + '" src="' + path + '">');
          editor.editable().fire('togglePlaceHolder', e);
      },
      onLoad:function(){
          var urlList = [
            {
                "name": "男性正面",
                "fid": null,
                "type": "男性正面",
                "imageData": "data:image/png;base64,",
                "序号": 1
            },
            {
                "name": "男性背面",
                "fid": null,
                "type": "男性背面",
                "imageData": "data:image/png;base64,",
                "序号": 2
            },
            {
                "name": "女性正面",
                "fid": null,
                "type": "女性正面",
                "imageData": "data:image/png;base64,",
                "序号": 3
            },
            {
                "name": "女性背面",
                "fid": null,
                "type": "女性背面",
                "imageData": "data:image/png;base64,",
                "序号": 4
            }
        ];
          var _this = this;
          _this.urlList  = urlList;
          for(var i=0;i< _this.urlList.length;i++){
            $('.right-area ul').append('<li>'+_this.urlList[i].name+'</li>');
          }
          $('.right-area ul li').get(0).style.fontWeight="bold";
          $('.right-area ul li').get(0).style.backgroundColor="#f3f3f3";
          $('#bodyPicId').attr('src',_this.urlList[0].imageData);
          $(".right-area ul").on("click","li",function(){
              $('.right-area ul li').css("font-weight", "normal");
              $('.right-area ul li').css("background-color", "#fff");
              $(this).css("font-weight", "bold");
              $(this).css("background-color", "#f3f3f3");

              for(var i=0;i<_this.urlList.length;i++){
                  if($(this).text() == _this.urlList[i].name){
                      $('#bodyPicId').attr('src',_this.urlList[i].imageData);
                  }
              }
          });
      }
	};
});

// Generate four random hex digits.
function S4() {
  return (((1+Math.random())*0x10000)|0).toString(16).substring(1);
};
// Generate a pseudo-GUID by concatenating random hexadecimal.
function guid() {
  return (S4()+S4()+"-"+S4()+"-"+S4()+"-"+S4()+"-"+S4()+S4()+S4());
};
